.drop-enter-active {
  animation: drop-in 0.3s;
}

.drop-leave-active {
  animation: drop-in 0.3s reverse;
}

@keyframes drop-in {
  0% {
    // transform: translateY(-100%);
    top: 35%;
    opacity: 0.7;
  }

  100% {
    /* margin-top: 10px; */
    opacity: 1;
  }
}

.common-homeDialog {
  .btnClass {
    margin-right: 10px;
  }

  .dialog-imgBox {
    min-height: 200px;
    max-height: 600px;
    overflow-y: scroll;
    position: relative;
    border-radius: 4px;
  }

  .dialog-imgBox-close {
    right: 20px;
    cursor: pointer;
    font-size: 20px;
    top: 12px;
    position: absolute;
  }

  .dialog-markAll {
    position: fixed;
    width: 100%;
    height: 100%;
    z-index: 999;
    top: 0;
    left: 0;
  }

  .dialog-frame {
    transform: 0.3s transition;
    position: fixed;
    z-index: 1000;
    left: 50%;
    top: 50%;
    transform: translate3d(-50%, -50%, 0);
    width: 800px;
    border-radius: 2px;
  }

  .dialog-frame-head {
    box-sizing: border-box;
    height: 60px;
    width: 100%;
    padding: 0 30px;
    line-height: 60px;
  }

  .dialog-frame-head-text {
    font-size: 16px;
  }

  .dialog-frame-head-close {
    float: right;
    cursor: pointer;
    font-size: 20px;
    margin-top: 12px;
  }

  .dialog-frame-body {
    width: 740px;
    min-height: 200px;
    max-height: 440px;
    overflow-y: scroll;
    margin-left: 30px;
    box-sizing: border-box;
    padding: 30px 0;
  }

  .closeBtnClass {
    font-size: 14px;
    margin-right: 10px;
  }

  .dialog-frame-bottom {
    // margin-bottom: 40px;
    height: 100px;
    position: relative;

    .dialog-frame-options {
      position: absolute;
      right: 30px;
      top: 30px;
    }

    .dialog-frame-options-oneBtn {
      right: 50%;
      transform: translateX(50%);
    }
  }
}
